import { useState } from 'react';

const RepositoriesList: React.FC = () => {
  const [term, setTerm] = useState('');

  return (
    <div>
      <form>
        <input value="term" onChange={e => setTerm(e.target.value)}/>
        <button type="submit">Search</button>
      </form>
    </div>
  )
};

export default RepositoriesList;
